import { setVideosList } from '../actions/ListAction'
import { useEffect, useState } from 'react';
import { NavBar } from '../cmps/NavBar';
import { useDispatch, useSelector } from 'react-redux';
import { Toolbar } from '../cmps/Toolbar';
import { FavoritesList } from '../cmps/FavoritesList';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    useHistory
} from 'react-router-dom';
import { Home } from './Home'
import { Play } from './Play';

export function VideoApp() {
    const dispatch = useDispatch()
    const { favorites } = useSelector(state => state.listModule)
    const [keyword, setKeyword] = useState('')
    const [menu, setMenu] = useState(false)

    function toggleMenuBar() {
        setMenu(!menu)

    }

    async function loadVideos(ev = null) {
        if (ev)
            ev.preventDefault();
        dispatch(setVideosList(keyword))
    }

    useEffect(() => {
        console.log('favor', favorites);
    }, [favorites])

    function keyWord(ev) {
        console.log('ev is:', ev);
    }


    return (
        <Router>
            <section>
                <NavBar
                    loadVideos={loadVideos}
                    toggleMenuBar={toggleMenuBar}
                    setKeyword={keyWord}
                    keyword={keyword}
                />

                {menu && <Toolbar />}

                <Switch>
                    <Route path="/play" component={Play} />
                    <Route path="/favorites" component={FavoritesList} />
                    <Route path="/" component={Home} />
                </Switch>

            </section>
        </Router>
    )
}
